CREATE PROCEDURE [dbo].[spAsset_GetById]
    @Asset_ID VARCHAR(100)
AS

BEGIN
    SET NOCOUNT ON;

    IF EXISTS (SELECT 1 FROM [dbo].[Asset] WHERE [Asset_ID] = @Asset_ID)
    BEGIN
        RAISERROR('Asset ID already exists.', 16, 1);
        RETURN;
    END

    INSERT INTO [dbo].[Asset] (
        [Asset_ID],
        [Asset_Name],
        [Branch_ID],
        [Branch_Name],
        [Asset_Quantity],
        [Asset_Cost]
        -- Asset_TotalCost is computed
    )
    VALUES (
        @Asset_ID,
        @Asset_Name,
        @Branch_ID,
        @Branch_Name,
        @Asset_Quantity,
        @Asset_Cost
    );
END;

