CREATE PROCEDURE [dbo].[spBranch_GetById]
    @Branch_ID VARCHAR(100)
AS

BEGIN
    SET NOCOUNT ON;

    IF EXISTS (SELECT 1 FROM [dbo].[Branch] WHERE [Branch_ID] = @Branch_ID)
    BEGIN
        RAISERROR('Branch ID already exists.', 16, 1);
        RETURN;
    END

    INSERT INTO [dbo].[Branch] (
        [Branch_ID],
        [Branch_Name],
        [Branch_Location],
        [Branch_State],
        [Branch_Status]
    )
    VALUES (
        @Branch_ID,
        @Branch_Name,
        @Branch_Location,
        @Branch_State,
        @Branch_Status
    );
END;

CREATE PROCEDURE [dbo].[spBranch_Insert]
    @Branch_ID        VARCHAR(100),
    @Branch_Name      VARCHAR(100),
    @Branch_Location  VARCHAR(200),
    @Branch_State     VARCHAR(100),
    @Branch_Status    BIT
AS

BEGIN
    SET NOCOUNT ON;

    SELECT [Branch_ID], [Branch_Name], [Branch_State]
    FROM [dbo].[Branch]
    WHERE [Branch_Status] = 1
    ORDER BY [Branch_Name];
END;

BEGIN
    SET NOCOUNT ON;

    IF NOT EXISTS (SELECT 1 FROM [dbo].[Branch] WHERE [Branch_ID] = @Branch_ID)
    BEGIN
        RAISERROR('Branch not found.', 16, 1);
        RETURN;
    END

    UPDATE [dbo].[Branch]
    SET
        [Branch_Name]     = @Branch_Name,
        [Branch_Location] = @Branch_Location,
        [Branch_State]    = @Branch_State,
        [Branch_Status]   = @Branch_Status
    WHERE [Branch_ID] = @Branch_ID;
END;

CREATE PROCEDURE [dbo].[spBranch_Update]
    @Branch_ID        VARCHAR(100),
    @Branch_Name      VARCHAR(100),
    @Branch_Location  VARCHAR(200),
    @Branch_State     VARCHAR(100),
    @Branch_Status    BIT
AS

BEGIN
    SET NOCOUNT ON;

    SELECT
        (SELECT COUNT(*) FROM [dbo].[Branch] WHERE [Branch_Status] = 1) AS ActiveBranchesCount,
        (SELECT COUNT(*) FROM [dbo].[Patient] WHERE [Patient_Stage] = 'T2') AS T2Count,
        (SELECT COUNT(*) FROM [dbo].[Patient] WHERE [Patient_Stage] = 'T3') AS T3Count,
        (SELECT COUNT(*) FROM [dbo].[Patient] WHERE [Patient_Stage] = 'T4') AS T4Count,
        (SELECT COUNT(*) FROM [dbo].[Patient] WHERE [Patient_Stage] = 'T5') AS T5Count;
END;

BEGIN
    SET NOCOUNT ON;

    SELECT
        [Patient_Stage],
        COUNT(*) AS [PatientCount]
    FROM [dbo].[Patient]
    WHERE (@Branch_State IS NULL OR @Branch_State = '' OR [Branch_State] = @Branch_State)
    GROUP BY [Patient_Stage];
END;

CREATE PROCEDURE [dbo].[spDashboard_PatientStageCountsByState]
    @Branch_State VARCHAR(100) = NULL
AS

BEGIN
    SET NOCOUNT ON;

    SELECT DISTINCT [Branch_State]
    FROM [dbo].[Patient]
    WHERE [Branch_State] IS NOT NULL
      AND LTRIM(RTRIM([Branch_State])) <> ''
    ORDER BY [Branch_State];
END;

BEGIN
    SET NOCOUNT ON;

    SELECT [State_ID], [State_Name]
    FROM [dbo].[LU_STATES]
    ORDER BY [State_Name];
END;

BEGIN
    SET NOCOUNT ON;

    DELETE FROM [dbo].[Patient]
    WHERE [Patient_ID] = @Patient_ID;
END;

